																																																																																													      void
																																																																																													      resolve_alias_in_expr_node
																																																																																													      (PT_NODE
																																																																																													       *
																																																																																													       node,
																																																																																													       PT_NODE
																																																																																													       *
																																																																																													       list)
																																																																																													    {
																																																																																													      if (!node)
																																																																																														{
																																																																																														  return;
																																																																																														}

																																																																																													      switch
																																																																																														(node->
																																																																																														 node_type)
																																																																																														{
																																																																																														case PT_SORT_SPEC:
																																																																																														  if (node->info.sort_spec.expr && node->info.sort_spec.expr->node_type == PT_NAME)
																																																																																														    {
																																																																																														      resolve_alias_in_name_node
																																																																																															(&node->
																																																																																															 info.
																																																																																															 sort_spec.
																																																																																															 expr,
																																																																																															 list);
																																																																																														    }
																																																																																														  else
																																																																																														    {
																																																																																														      resolve_alias_in_expr_node
																																																																																															(node->
																																																																																															 info.
																																																																																															 sort_spec.
																																																																																															 expr,
																																																																																															 list);
																																																																																														    }
																																																																																														  break;

																																																																																														case PT_EXPR:
																																																																																														  if (node->info.expr.arg1 && node->info.expr.arg1->node_type == PT_NAME)
																																																																																														    {
																																																																																														      resolve_alias_in_name_node
																																																																																															(&node->
																																																																																															 info.
																																																																																															 expr.
																																																																																															 arg1,
																																																																																															 list);
																																																																																														    }
																																																																																														  else
																																																																																														    {
																																																																																														      resolve_alias_in_expr_node
																																																																																															(node->
																																																																																															 info.
																																																																																															 expr.
																																																																																															 arg1,
																																																																																															 list);
																																																																																														    }
																																																																																														  if (node->info.expr.arg2 && node->info.expr.arg2->node_type == PT_NAME)
																																																																																														    {
																																																																																														      resolve_alias_in_name_node
																																																																																															(&node->
																																																																																															 info.
																																																																																															 expr.
																																																																																															 arg2,
																																																																																															 list);
																																																																																														    }
																																																																																														  else
																																																																																														    {
																																																																																														      resolve_alias_in_expr_node
																																																																																															(node->
																																																																																															 info.
																																																																																															 expr.
																																																																																															 arg2,
																																																																																															 list);
																																																																																														    }
																																																																																														  if (node->info.expr.arg3 && node->info.expr.arg3->node_type == PT_NAME)
																																																																																														    {
																																																																																														      resolve_alias_in_name_node
																																																																																															(&node->
																																																																																															 info.
																																																																																															 expr.
																																																																																															 arg3,
																																																																																															 list);
																																																																																														    }
																																																																																														  else
																																																																																														    {
																																																																																														      resolve_alias_in_expr_node
																																																																																															(node->
																																																																																															 info.
																																																																																															 expr.
																																																																																															 arg3,
																																																																																															 list);
																																																																																														    }
																																																																																														  break;

																																																																																														default:;
																																																																																														}
																																																																																													    }


																																																																																													    static
																																																																																													      void
																																																																																													      resolve_alias_in_name_node
																																																																																													      (PT_NODE
																																																																																													       **
																																																																																													       node,
																																																																																													       PT_NODE
																																																																																													       *
																																																																																													       list)
																																																																																													    {
																																																																																													      PT_NODE
																																																																																														*
																																																																																														col;
																																																																																													      char
																																																																																														*n_str,
																																																																																														*c_str;
																																																																																													      bool
																																																																																														resolved
																																																																																														=
																																																																																														false;

																																																																																													      n_str
																																																																																														=
																																																																																														parser_print_tree
																																																																																														(this_parser,
																																																																																														 *node);

																																																																																													      for
																																																																																														(col
																																																																																														 =
																																																																																														 list;
																																																																																														 col;
																																																																																														 col
																																																																																														 =
																																																																																														 col->
																																																																																														 next)
																																																																																														{
																																																																																														  if (col->node_type == PT_NAME)
																																																																																														    {
																																																																																														      c_str
																																																																																															=
																																																																																															parser_print_tree
																																																																																															(this_parser,
																																																																																															 col);
																																																																																														      if (c_str == NULL)
																																																																																															{
																																																																																															  continue;
																																																																																															}

																																																																																														      if (intl_identifier_casecmp (n_str, c_str) == 0)
																																																																																															{
																																																																																															  resolved
																																																																																															    =
																																																																																															    true;
																																																																																															  break;
																																																																																															}
																																																																																														    }
																																																																																														}

																																																																																													      if (resolved != true)
																																																																																														{
																																																																																														  for
																																																																																														    (col
																																																																																														     =
																																																																																														     list;
																																																																																														     col;
																																																																																														     col
																																																																																														     =
																																																																																														     col->
																																																																																														     next)
																																																																																														    {
																																																																																														      if (col->alias_print && intl_identifier_casecmp (n_str, col->alias_print) == 0)
																																																																																															{
																																																																																															  parser_free_node
																																																																																															    (this_parser,
																																																																																															     *node);
																																																																																															  *node
																																																																																															    =
																																																																																															    parser_copy_tree
																																																																																															    (this_parser,
																																																																																															     col);
																																																																																															  (*node)->next = NULL;
																																																																																															  break;
																																																																																															}
																																																																																														    }
																																																																																														}
																																																																																													    }
